import functools
from typing import Optional

from common.tree_node import TreeNode


class Solution:
    def largestGoodInteger(self, num: str) -> str:
        ans = ""
        cur = ""
        for i in range(len(num)):
            if len(cur) == 0:
                cur = num[i]
                continue
            if num[i] == cur[-1]:
                cur += num[i]
            else:
                if len(cur) >= 3:
                    cur = cur[:3]
                    if not ans:
                        ans = cur
                    elif cur > ans:
                        ans = cur
                cur = num[i]
        if len(cur) >= 3:
            cur = cur[:3]
            if not ans:
                ans = cur
            elif cur > ans:
                ans = cur
        return ans

    def averageOfSubtree(self, root: Optional[TreeNode]) -> int:
        @functools.lru_cache(None)
        def helper(node: TreeNode):
            cur = node.val
            cnt = 1
            left = [0, 0]
            right = [0, 0]
            if node.left:
                left = helper(node.left)
            if node.right:
                right = helper(node.right)
            cur += left[0] + right[0]
            cnt += left[1] + right[1]
            if cur // cnt == node.val:
                nonlocal ans
                ans += 1
            return [cur, cnt]

        ans = 0
        helper(root)
        return ans

    def countTexts(self, pressedKeys: str) -> int:
        @functools.lru_cache(None)
        def dfs(steps: int, total: int) -> int:
            if total == 0:
                return 1
            ret = 0
            for i in range(1, steps + 1):
                if i <= total:
                    ret += dfs(steps, total - i)
                else:
                    break
            return ret % mod

        mod = int(1e9 + 7)
        ans = 1
        cur = ''
        cnt = 0
        pressedKeys += '0'
        for i in range(len(pressedKeys)):
            key = pressedKeys[i]
            if len(cur) == 0 or cur[-1] == key:
                cur += key
                cnt += 1
            else:
                ret = dfs(4, cnt) if cur[-1] == '7' or cur[-1] == '9' else dfs(3, cnt)
                ans = ans * ret % mod
                cur = key
                cnt = 1
        return ans % mod


if __name__ == '__main__':
    sol = Solution()
    print(sol.countTexts("222222222222222222222222222222222222"))
    print(sol.countTexts(""))
